function eventChatCommand(n,m)
if m == "help" then
tfm.exec.chatMessage("Neste module, o shaman tem 2 minutos para construir um foguete que precisa levar todos os ratos para o espaço! Caso o shaman morra, a partida é encerrada.<br><br>Script criado por Miss_fortune#9548. Mapa criado por Fosfus7heads#0000. Conceito original de Nettoork#0000.",n)
end
if m == "cancel" then
if n == "Miss_fortune#9548" or n == "Spectra_phantom#6089" or n == "Fosfus7heads#0000" then
	tfm.exec.setGameTime(5)
	tfm.exec.chatMessage("<R>Rodada cancelada! Iniciando uma nova rodada...")
end
end
end
function eventLoop(p,f)
if mode == "fly" then
loop=loop+1
end
if f < 1000 then
tfm.exec.newGame(map)
mode="building"
end
if p > 120000 then
if mode == "building" then
mode="fly"
end
for n,p in pairs(tfm.get.room.playerList) do
if p.y < 230 and f > 5000 then
tfm.exec.giveCheese(n)
tfm.exec.playerVictory(n)
mode="ending"
end
end
end
if p > 123000 then
if p < 123600 then
tfm.exec.chatMessage("<R>Tempo esgotado! Está na hora de voar!<br><br><ROSE><b>Atenção! Objetos voadores estão caindo do céu!</b>")
for n,p in pairs(tfm.get.room.playerList) do
if tfm.get.room.playerList[n].isShaman then
tfm.exec.setShaman(n,false)
end
end
end
for i=1,2 do
tfm.exec.addShamanObject(math.random(1,10), math.random(-400,2000), 1, 0, 0, 0, false)
loop=0
end
end
end
